class IPUtilities {
  constructor() {
    this.ip = null;
    this.fetchIP();
  }

  fetchIP() {
    fetch("https://api64.ipify.org?format=json")
      .then(response => response.json())
      .then(data => {
        this.ip = data.ip;
      })
      .catch(error => {
        console.error("Failed to fetch IP:", error);
      });
  }

  getIP() {
    return this.ip || "Fetching...";
  }

  checkIP(ipToCheck) {
    return this.ip === ipToCheck;
  }

  getInfo() {
    return {
      id: "ipUtilities",
      name: "IP Utilities",
      menuIconURI: "data:image/png;base64,data:image/png;base64,",
      blocks: [
        {
          opcode: "getIP",
          blockType: Scratch.BlockType.REPORTER,
          text: "your IP address"
        },
        {
          opcode: "checkIP",
          blockType: Scratch.BlockType.BOOLEAN,
          text: "IP is [IP]",
          arguments: {
            IP: { type: Scratch.ArgumentType.STRING, defaultValue: "127.0.0.1" }
          }
        }
      ]
    };
  }
}

Scratch.extensions.register(new IPUtilities());
